import React from 'react';
import './homemain.css';
import Container from '../../../Container.jsx';



function Homemain(props) {
  return (
     <div className="homemain">

     <Container>
     <div className="onesection">
           <div className="bg">
               <div className="bgtitle">

               </div>
           </div>
           <div className="bg">

           </div>
      </div>
     </Container>


    </div>
  );
}

export default Homemain;
